import React from 'react';
import Card from './Card';


const CardList = ({ robots }) => {
  return (
    <div>
      {
        (robots) ?
        robots.map(robot => <Card
          key={ robot.id }
          id={ robot.id }
          name={ robot.name }
          email={ robot.email }
          username={ robot.username }/>
        ) : (robots)
      }
    </div>
  );
}

export default CardList;
